pragma solidity 0.8.7;

import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Base64.sol";


library SnakeLib {

    struct ColorScheme {
        string metadata;
        string title;
        string start;
        string directions;
        string score;
        string background;
        string map;
        string food;
        string snake;
    }

    // string internal constant svgStart = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 1000 1000">';
    // string internal constant svgMid = '<g stroke="#000" > <rect class="background" x="0" y="0" width="1000" height="1000"/> <rect class="map" x="200" y="200" width="600" height="600"/> </g> <text y="120" x="50%" text-anchor="middle" class="title">snake</text> <text id="startText" x="50%" y="600" text-anchor="middle" class="start" ></text> <text id="directions" x="50%" y="650" text-anchor="middle" class="directions" ></text> <text x="900" y="250" text-anchor="middle" class="score" > Score:</text> <text id="scoreCounter" x="830" y="300" class="score" ></text> <text  x="900" y="550" text-anchor="middle" class="highScore" > high scores:</text> <text id="hs1" x="830" y="600" class="score" ></text> <text id="hs2" x="830" y="650" class="score" ></text> <text id="hs3" x="830" y="700" class="score" ></text> <text id="hs4" x="830" y="750" class="score" ></text> <text id="hs5" x="830" y="800" class="score" ></text>';
    
    string internal constant svgEnd = '<rect id="snake" class="snake" x="500" y="500" width="20" height="20"/> <rect id="food" class="food" x="-50" y="-50" width="20" height="20"/>';

