    function base64ImageUrl(address owner, uint id, ColorScheme memory scheme) internal pure returns (string memory) {
        string memory svgBase64 =  Base64.encode(bytes(fullSVGImage(owner,id, scheme)));
        return string(abi.encodePacked("data:image/svg+xml;base64,",svgBase64));
    }

    // function pureSVGImage(address owner, uint id, ColorScheme memory scheme) internal pure returns (string memory) {
    //     string memory metadata = getMetadata(owner, id);
    //     string memory styles = getStyle(scheme);
    //     return string(abi.encodePacked(svgStart, styles, svgMid, metadata, svgEnd, '</svg>'));
    // }

    function fullSVGImage(address owner, uint id, ColorScheme memory scheme) internal pure returns (string memory) {
        string memory svgStart = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 1000 1000">';
        string memory svgMid = '<g stroke="#000" > <rect class="background" x="0" y="0" width="1000" height="1000"/> <rect class="map" x="200" y="200" width="600" height="600"/> </g> <text y="120" x="50%" text-anchor="middle" class="title">snake</text> <text id="startText" x="50%" y="600" text-anchor="middle" class="start" ></text> <text id="directions" x="50%" y="650" text-anchor="middle" class="directions" ></text> <text x="900" y="250" text-anchor="middle" class="score" > Score:</text> <text id="scoreCounter" x="830" y="300" class="score" ></text> <text  x="900" y="550" text-anchor="middle" class="highScore" > high scores:</text> <text id="hs1" x="830" y="600" class="score" ></text> <text id="hs2" x="830" y="650" class="score" ></text> <text id="hs3" x="830" y="700" class="score" ></text> <text id="hs4" x="830" y="750" class="score" ></text> <text id="hs5" x="830" y="800" class="score" ></text>';
        string memory metadata = getMetadata(owner, id);
        string memory styles = getStyle(scheme);
        string memory svg = Base64.encode(abi.encodePacked(svgStart, styles, svgMid, metadata, svgEnd, SVGScriptTag, '</svg>' ));
        return string(abi.encodePacked("data:image/svg+xml;base64,",svg)); 

    }

    // function base64HtmlUrl(address owner, uint id, ColorScheme memory scheme) internal pure returns (string memory) {
    //     string memory base64Html = Base64.encode(abi.encodePacked('<!DOCTYPE html><html><meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1"/><meta charset="utf-8"/>', pureSVGImage(owner, id, scheme), htmlScriptTag, '</html>'));
    //     return string(abi.encodePacked("data:text/html;base64,", base64Html));
    // }

    

    function getMetadata(address owner, uint id) internal pure returns (string memory){
        string memory _owner = Strings.toHexString(uint160(owner), 20);
        string memory _id = Strings.toString(id);

        return string(abi.encodePacked('<g class="metadata"> <text x="50" y="900" >owner: ', 
        _owner, 
        '</text> <text x="50" y="950">',
        _id, 
        '/10000</text> </g>'
        ));



    }
    function getStyle(ColorScheme memory scheme) internal pure returns(string memory ) {
        
        return string(abi.encodePacked(
            '<style> .metadata { font:  30px Courier; fill: #',
            scheme.metadata, 
            ' } .title { font:  80px Courier; fill: #', 
            scheme.title, 
            ' } .start {font: 35px Courier; fill-opacity: .70; fill: #', 
            scheme.start,
            '} .directions {font: italic 30px Courier; fill-opacity: .70; fill: #',
            scheme.directions,
            ' } .score {font: 40px Courier; fill: #',
            scheme.score,
            '} .highScore {font: 25px Courier; fill: #',
            scheme.score,
            '} .background {fill: #',
            scheme.background,
            '} .map {fill: #',
            scheme.map,
            '} .food {stroke: #000; fill: #',
            scheme.food,
            '} .snake{stroke: #000; fill: #',
            scheme.snake,
            '} </style>'
            
            ));


    }


    function generateTokenURI(address owner, uint id, ColorScheme memory scheme, string memory frontEnd, uint schemeIndex) internal pure returns(string memory) {

        string memory imageUrl = base64ImageUrl(owner, id, scheme);
        // string memory htmlUrl = base64HtmlUrl(owner, id, scheme);
        return
          string(
              abi.encodePacked(
                'data:application/json;base64,',
                Base64.encode(
                    bytes(
                          abi.encodePacked(
                              '{"name":"',
                              "Snake #",
                              Strings.toString(id),
                              '", "description":',
                              '"Fully on chain game of Snake. To enjoy, simply copy the image url and paste it in a web browser. Or, visit our [Official Website](',
                              frontEnd,
                              ') to view and play your games."',
                              ', "external_url":"',
                              frontEnd,
                              '", "attributes": [{"trait_type": "Color Scheme", "value":"',
                              Strings.toString(schemeIndex),
                              '"}], "owner":"',
                              Strings.toHexString(uint160(owner), 20),
                              '", "image": "',
                              imageUrl,
                            //   '", "animation_url":"',
                            //   htmlUrl,
                              '"}'
                          )
                        )
                    )
              )
          );

    }


}

